import React from "react";
import { Link } from "react-router-dom";
import styled from "styled-components";

function HomeSearch() {


    return (
        <Wrapper>
            <div className="container p-2 top-margin">
                <div className="container">
                    <div className="row">
                        <div className="col-sm-4">
                            <div className="card">
                                <div className="card-body">
                                    <label>
                                        <h5 name="From" className="card-title">From</h5>
                                    </label>
                                    <p className="card-text">
                                        <input name="From" className="custom-input" value="NewDelhi" />
                                    </p>
                                </div>
                            </div>
                        </div>

                        <div className="col-sm-4">
                            <div className="card">
                                <div className="card-body">
                                    <label>
                                        <h5 name="To" className="card-title">To</h5>
                                    </label>
                                    <p className="card-text">
                                        <input name="To" className="custom-input" value="Mumbai" />
                                    </p>
                                </div>
                            </div>
                        </div>

                        <div className="col-sm-4">
                            <div className="card">
                                <div className="card-body">
                                    <label>
                                        <h5 name="Date" className="card-title">Date</h5>
                                    </label>
                                    <p className="card-text">
                                        <input name="Date" className="custom-input" value="20-Feb-2024"/>
                                    </p>
                                </div>
                            </div>
                        </div>
                    </div>
                    <div className="row mt-3 mb-2">
                        <div className="col-sm-12 text-center">
                            <button type="button" className="btn btn-pad"><p>
                                <Link className="react-link" to='/searched-trains'>
                                Search
                                </Link>
                            </p>
                            </button>
                        </div>
                    </div>
                </div>
            </div>
        </Wrapper>
    );
}

const Wrapper = styled.div`
    /* margin: 40vh 10vw 0vh 10vw; */
    position: relative;
    bottom: 2rem; 

    @media (max-width: 768px) {
        bottom: 1rem; 
    }

    @media (max-width: 576px) {
        bottom: 4rem; 
    }

    .custom-input {
      border: none;
      /* Additional styles as needed */
    }

    /* .container{
        background-color: skyblue;
    } */

    .card{
        box-shadow: -5px 5px 10px rgba(0, 0, 0, 0.3);
    }

    .btn{
        height: 3.5rem;
        width: 11rem;
        border-radius: 50px;
        background-color: #189AD3;
        /* background-color: #001a2d; */

        margin-top: 2rem;
        box-shadow: -5px 5px 10px rgba(0, 0, 0, 0.3)
    }
    .btn-pad{
        padding: 8px 2px 12px 2px;
    }
    .card{
        box-shadow: -5px 5px 10px rgba(0, 0, 0, 0.3);
    }
    .react-link{
        color: red;
    }
`

export default HomeSearch;
